import React from 'react';

const Test2 = (props) => {
    let test_2_fu = props.data.test2.test2_today.map(el => <ErrorID id={el.number} err={el.error} text={el.textError} />)

    return (
        <div style={{ color: "red" }}>
            {test_2_fu}
        </div>
    )
}
export default Test2;
